import React from 'react';

import '../css/main.scss'

class Main extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            artists : []
        }
    }
    componentDidMount(){
        console.log(this.state.artists)
    }

    render(){
        let artists = ''
        if(this.props.found_data != ''){
            artists = JSON.parse(this.props.found_data)
            artists = artists.data.artists.items
            console.log(artists)
        } 
        return (
            <main>
                {artists ? artists.map(
                    (artist, key) => {
                        console.log(artist)
                        console.log(key)
                        return <h1>{artist.name}</h1>
                    }) 
                    : <h1>'no'</h1>}
            </main>
        )

    }
}




export default Main;
